import React, { Component } from 'react';
import hashFunction from './bcrypt';
import {Button, Form} from 'react-bootstrap';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';
import ChangeEvent from 'react';

const bcrypt = require('./bcrypt');

class LogInPage extends Component {
  constructor(props) {
    super(props);
    this.state = {
      username: null,
      password: null,
    }
  }


  onLogIn = async () => {
    try {
      if (this.state.username && this.state.password) {
        //const hashedPassword = await bcrypt.hashPassword(this.state.password);
        const sendData = JSON.stringify({"employee_username":this.state.username})
        const response = await axios.put(this.props.server+"/log-in",{employee_username: 'john12'});
        console.log(response);
        console.log(response.data[0].employee_password);
      }
    }
    catch (e) {
      alert("Server is not running.");
    }
  }

  render() {
    return (
      <div style={{textAlign:"center"}}>
        <h1>Log-In Page</h1>
        <Form>
      <Form.Group oclassName="mb-3" controlId="formBasicEmail">
        <Form.Label>Username</Form.Label>
        <Form.Control onChange={(e: ChangeEvent) => this.setState({username: e.target.value})} type="email" placeholder="Enter username" />
      </Form.Group>
      <Form.Group className="mb-3" controlId="formBasicPassword">
        <Form.Label>Password</Form.Label>
        <Form.Control onChange={(e: ChangeEvent) => this.setState({password: e.target.value})} type="email" placeholder="Enter password" />
      </Form.Group>
      </Form>
        <Button onClick={this.onLogIn} variant="primary">Log-In</Button>
      </div>
    );

  }
}

export default LogInPage;
